import React, { Component } from 'react';
import { connect } from 'react-redux';
import moment from 'moment-js';
import { Link } from 'react-router-dom';

// import { getUserPosts } from '../../actions';
import { getUserItems, getAllItems } from '../../actions';



class Sandbox extends Component {


    // componentWillMount() {
    componentDidMount() {
        this.props.dispatch(getUserItems(this.props.user.login.id))
        this.props.dispatch(getAllItems())

    }



    showUserItems = (items) => (
        items.items ?
            items.items.map(item => (
                <span key={item._id}> 


							{/* <span>cp ./sq_thumb/</span>
                            { item.omeka ?
								item.omeka.omeka_id
                            : null}
							<span>.jpg</span> */}



							{/* <span>mv -v ./thumbnail/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>.jpg ./byid/</span>{ item.omeka ? item._id: null}<span>/thumbnail/0.jpg; </span>							 */}
							<span>mv -v ./thumbnail/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_2.jpg ./byid/</span>{ item.omeka ? item._id: null}<span>/thumbnail/1.jpg; </span>
							<span>mv -v ./thumbnail/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_3.jpg ./byid/</span>{ item.omeka ? item._id: null}<span>/thumbnail/2.jpg; </span>
							<span>mv -v ./thumbnail/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_4.jpg ./byid/</span>{ item.omeka ? item._id: null}<span>/thumbnail/3.jpg; </span>
							<span>mv -v ./thumbnail/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_5.jpg ./byid/</span>{ item.omeka ? item._id: null}<span>/thumbnail/4.jpg; </span>
							<span>mv -v ./thumbnail/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_6.jpg ./byid/</span>{ item.omeka ? item._id: null}<span>/thumbnail/5.jpg; </span>
							<span>mv -v ./thumbnail/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_7.jpg ./byid/</span>{ item.omeka ? item._id: null}<span>/thumbnail/6.jpg; </span>
							<span>mv -v ./thumbnail/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_8.jpg ./byid/</span>{ item.omeka ? item._id: null}<span>/thumbnail/7.jpg; </span>
							<span>mv -v ./thumbnail/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_9.jpg ./byid/</span>{ item.omeka ? item._id: null}<span>/thumbnail/8.jpg; </span>
							<span>mv -v ./thumbnail/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_10.jpg ./byid/</span>{ item.omeka ? item._id: null}<span>/thumbnail/9.jpg; </span>
							<span>mv -v ./thumbnail/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_11.jpg ./byid/</span>{ item.omeka ? item._id: null}<span>/thumbnail/10.jpg; </span>


							{/* <span>;</span> */}
							{/* <br/> */}
                </span>
            ))
        : null
    )


    render() {
        // console.log(this.props);

        let items = this.props.items;

        return (
            <div className="user_posts">

                        {this.showUserItems(items)}

            </div>
        );
    }
}

function mapStateToProps(state) {

    console.log(state);
    return {
        user:state.user,
        items:state.items
    }
}


export default connect(mapStateToProps)(Sandbox)
